import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  text: { fontSize: 30, fontWeight: "bold", height: 500 },
  btnText: {
    color: "#00f",
    fontSize: 30,
    fontWeight: "400",
    margin: 10,
  },
  btnContainer: {
    backgroundColor: "#c1f3f7",
    alignItems: 'center',
    padding: 10,
    margin: 10,
    borderRadius: 8,
  },
});

export default styles;
